campaignTrail_temp.questions_json = JSON.parse("[{\"model\": \"campaign_trail.question\", \"pk\": 717, \"fields\": {\"priority\": 1, \"description\": \"January 2021: The CDU is looking for a new party leader at their party congress after the resignation of Annegret Kramp-Karrenbauer. You lost the last leadership election, and are ready to try again. Friedrich Merz, how do you want to defeat Laschet and Röttgen?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 718, \"fields\": {\"priority\": 1, \"description\": \"Congratulations, you are now the party leader of the CDU. You are not the official chancellor candidate of the Union of CDU and CSU yet, but hopefully, that will just be a formality. What issues do you want to focus on?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 719, \"fields\": {\"priority\": 1, \"description\": \"March 2021: COVID-19 and the countermeasures against it have shaped the lives of people in Germany for the past years. Now that the winter is over, a lot of people are demanding an end to the harsh lockdowns. While you’re not a member of the government or a state government, people still want to know your position.\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 720, \"fields\": {\"priority\": 1, \"description\": \"Tax policy is an important topic every election season. Left-wing parties like the SPD and the Greens want to raise taxes, while the FDP wants to lower them. What is your position?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 721, \"fields\": {\"priority\": 1, \"description\": \"A report from the news magazine “Der Spiegel” has revealed that several CDU and CSU MPs have been implicated in corrupt dealings. They were part of a scheme to sell overpriced medical masks to government organizations. What is your reaction to this scandal?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 722, \"fields\": {\"priority\": 1, \"description\": \"April 2021: Olaf Scholz has been declared chancellor candidate by the SPD last year already and there are rumours the Green party is about to nominate someone as well soon. Do you want to formally declare your candidacy yet?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 723, \"fields\": {\"priority\": 1, \"description\": \"You and Söder both want to become the chancellor candidate for the Union of CDU/CSU. Both of you have supporters and detractors within the party. How do you want to decide this?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 724, \"fields\": {\"priority\": 1, \"description\": \"Wow, that was a close one! Now that you have jumped the last hurdle and formally became chancellor candidate, what do you want to say at the press conference?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 725, \"fields\": {\"priority\": 1, \"description\": \"The Green party has, for the first time in its history, nominated a chancellor candidate. Annalena Baerbock appears to be your main contender, as she’s even ahead of you in some polls, while Olaf Scholz of the SPD is far behind in third place. What’s your strategy regarding your two contenders?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 726, \"fields\": {\"priority\": 1, \"description\": \"Michael Kretschmer, your party colleague and Minister-President of Saxony, has recently travelled to Moscow and has been criticized for that visit. What’s your stance on relationships with Russia and Putin?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 727, \"fields\": {\"priority\": 1, \"description\": \"May 2021: The Federal Constitutional Court just ruled the Climate Protection Act unconstitutional and demands the government do more to lower emissions. The federal government in Berlin is now working on making the law stricter. Do you have a position on this?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 728, \"fields\": {\"priority\": 1, \"description\": \"A controversy from 2018 has resurfaced when you claimed that you were part of the middle class despite owning two private jets and earning around 1.00.000€ per year. What can you say to clarify this?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 729, \"fields\": {\"priority\": 1, \"description\": \"You have been invited to talk about German foreign and defence policy. What talking points do you want to emphasise?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 730, \"fields\": {\"priority\": 1, \"description\": \"June 2021: After some smaller scandals came out, Baerbock of the Green Party is starting to struggle a bit in the polls. Also,  the CDU was the big winner at the provincial elections in Saxony-Anhalt, with Minister-President Reiner Haseloff massively increasing the vote share of the CDU. Do you have a comment?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 731, \"fields\": {\"priority\": 1, \"description\": \"Digitalization is an important topic in this election, with all parties unveiling plans for how to move forward with this. What is the plan of the CDU?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 732, \"fields\": {\"priority\": 1, \"description\": \"July 2021: Widespread flooding is affecting large areas of western, southern and middle Germany. Your home state, North Rhine-Westphalia, is among the most affected. Do you have a first statement?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 733, \"fields\": {\"priority\": 1, \"description\": \"Post-flood cleanup operations are going on as the full devastation of the flooding becomes clear. Many advisors urge you to get out and show yourself as a man of action.\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 734, \"fields\": {\"priority\": 1, \"description\": \"Climate change is a much-discussed topic again after the floodings. You have been asked to clarify your stance on how to best combat climate change.\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 735, \"fields\": {\"priority\": 1, \"description\": \"After early successes, the vaccination campaign has become sluggish in recent weeks. Some politicians are going so far as to demand making the vaccine mandatory.\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 736, \"fields\": {\"priority\": 1, \"description\": \"August 2020: The SPD has been surging in the polls, drawing votes from both you and the Green Party. Both parties also started to attack you for some votes you made as an MP in the 90s, like voting against harder punishments for the rape of a spouse.\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 737, \"fields\": {\"priority\": 1, \"description\": \"It is basically guaranteed that there will be a coalition government after the elections. Which party would you be willing to govern with?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 738, \"fields\": {\"priority\": 1, \"description\": \"Pictures of the disastrous retreat of NATO troops from Afghanistan go around the globe. The government is sharply criticised for its botched evacuation. What do you want to emphasize in this situation?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 739, \"fields\": {\"priority\": 1, \"description\": \"September 2021: For the first time in German history, there will be a three-way debate, a so-called “Triell”. You, Scholz of the SPD and Baerbock of the Green party are all invited. What do you want to focus on?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 740, \"fields\": {\"priority\": 1, \"description\": \"During the Triell, you decided to focus on Olaf Scholz, vice chancellor and candidate of the SPD. What do you want to attack him on?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 743, \"fields\": {\"priority\": 1, \"description\": \"Finally, this campaign is coming to an end. Do you have anyone, in particular, you want to campaign with during the last days before the election?\", \"likelihood\": 1.0}}]");
extraQuestions = JSON.parse("[{\"model\": \"campaign_trail.question\", \"pk\": 741, \"fields\": {\"priority\": 1, \"description\": \"During the Triell, you decided to focus on Annalena Baerbock, chancellor candidate of the Green party. What do you want to attack her on?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 742, \"fields\": {\"priority\": 1, \"description\": \"During the Triell, you decided to focus on presenting your case to the German people without too strong attacks. What are your main points?\", \"likelihood\": 1.0}}]");
campaignTrail_temp.answers_json = JSON.parse("[{\"model\": \"campaign_trail.answer\", \"pk\": 4000, \"fields\": {\"question\": 717, \"description\": \"After sixteen years of Merkel, we have to take this country in a new direction. I promise to return the CDU closer to its conservative roots.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4001, \"fields\": {\"question\": 717, \"description\": \"Perhaps I can strike a deal with Röttgen. I’ll offer him a cabinet post once I become chancellor and to adopt some of his environmental policies if he endorses me after he is eliminated.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4002, \"fields\": {\"question\": 717, \"description\": \"I will moderate a bit compared to my last attempt to become party leader. I’ll focus more on my economic proposals and promise to not undo the progress of the Merkel era while staying true to my conservative beliefs.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4003, \"fields\": {\"question\": 717, \"description\": \"This party desperately needs a fresh face, not someone who stands for nothing more than a continuation. The failure of Kramp-Karrenbauer has shown we need to move forward, and not copy Merkel!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4004, \"fields\": {\"question\": 718, \"description\": \"While I’m critical of some things that have been decided under Merkel’s chancellorship, I still want to praise her and promise to continue the competency she has displayed when governing this country.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4005, \"fields\": {\"question\": 718, \"description\": \"The CDU is the party of the middle of society. Despite some of my personal beliefs, I will keep moving the party into the future, with a moderate course on the issues of the day.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4006, \"fields\": {\"question\": 718, \"description\": \"The right wing of the party which has often been ignored by Merkel is still a significant force, my election has shown that. Under my leadership, we will bring the party back on a more conservative path.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4007, \"fields\": {\"question\": 718, \"description\": \"There will be no strong major shift to the right under my leadership - however, there will be a clearer profile. I will also emphasize my belief in the neoliberal economic doctrine.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4008, \"fields\": {\"question\": 719, \"description\": \"While the lockdowns were the right thing to do, now that the winter is over and we have started to vaccinate people, it is time to return to normalcy quickly.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4009, \"fields\": {\"question\": 719, \"description\": \"The situation is still very volatile and it is better to be cautious than reckless. We should keep the lockdowns for the foreseeable future.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4010, \"fields\": {\"question\": 719, \"description\": \"In general, I’m in favour of opening up. Let’s closely monitor the case numbers though and let the states decide individually depending on their situation.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4011, \"fields\": {\"question\": 719, \"description\": \"This is a decision the federal government and the states have to make. I don’t want to undermine them by giving an opinion.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4012, \"fields\": {\"question\": 720, \"description\": \"Under no circumstances will we raise taxes, but we don’t want to dramatically lower them. We will phase out the extra tax of the Soli and try to reduce the burden on small and medium-income earners while keeping the budget balanced.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4013, \"fields\": {\"question\": 720, \"description\": \"The Covid crisis has left a massive hole in our budget that we have to plug somehow. We have to be measured, but a tax increase will likely be necessary.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4014, \"fields\": {\"question\": 720, \"description\": \"Taxes for private households should stay where they are or even be lowered by phasing out the Soli. More importantly, corporate taxes should be lowered to unleash the full economic potential of this country.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4015, \"fields\": {\"question\": 720, \"description\": \"To stimulate the economy after the Covid crisis, taxes have to be lowered across the board for both private households and corporations. We also have to streamline tax bureaucracy.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4016, \"fields\": {\"question\": 721, \"description\": \"I’m shocked about these deals, all people involved should have their immunity stripped so they can be investigated. Let’s however not judge the whole party for the actions of some black sheep.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4017, \"fields\": {\"question\": 721, \"description\": \"Let’s wait and see how this develops. I’ll issue a brief statement that we want to wait until it’s clear what actually happened.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4018, \"fields\": {\"question\": 721, \"description\": \"This is nothing but a political hit job by a left-wing magazine in an election year. I’m sure further investigations will prove the innocence of these MPs.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4019, \"fields\": {\"question\": 721, \"description\": \"These deals are another sad example of how the intertwining of politics and business leads to corrupt dealings. Under my leadership, we will root out this corruption!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4020, \"fields\": {\"question\": 722, \"description\": \"This seems like a good time to declare my candidacy, yes. Though before I declare, I will call Markus Söder, the party leader of our sister party, the CSU, to make sure he won’t oppose me.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4021, \"fields\": {\"question\": 722, \"description\": \"Now would be a good time to formally announce my candidacy, yes. I’ll call for a press conference as soon as possible.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4022, \"fields\": {\"question\": 722, \"description\": \"You know, it might be better to wait this out a bit longer. I can declare after whatever announcement the Green party makes to get them out of the limelight.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4023, \"fields\": {\"question\": 723, \"description\": \"Let’s call every big name in the party, maybe we can even get Merkel herself to weigh in. I don’t want a vote in the parliamentary group, I want this decided by the party elites now.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4024, \"fields\": {\"question\": 723, \"description\": \"It’s no secret that Söder doesn’t like me. I’ll frame this as a personal vendetta and accuse him of dragging down both of our parties in an election year.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4025, \"fields\": {\"question\": 723, \"description\": \"The party parliamentary group of CDU and CSU shall vote on this. I’m confident they will pick me over Söder. After all, the CDU is much bigger than the CSU.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4026, \"fields\": {\"question\": 723, \"description\": \"The party parliamentary group of CDU and CSU shall vote on this. I’m confident they will pick me over Söder. After all, the CDU is much bigger than the CSU.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4027, \"fields\": {\"question\": 724, \"description\": \"First and foremost, I want to thank Markus Söder for accepting the result. We have to be united as a party to win this fall. Apart from that, I will hit my usual talking points.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4028, \"fields\": {\"question\": 724, \"description\": \"This whole episode has shown me that many people are still not convinced that I’m the right man to govern Germany. I’ll moderate a bit and make it clear that I want to appeal to all German people.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4029, \"fields\": {\"question\": 724, \"description\": \"I will give a largely non-political speech and focus on the importance of staying true to our roots and the tradition of this party.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4030, \"fields\": {\"question\": 724, \"description\": \"Now is the perfect opportunity to emphasize that this country is in dire need of change and a new direction. I will promise to modernize Germany while letting our conservative values guide us in this progress.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4031, \"fields\": {\"question\": 725, \"description\": \"The Green party is always surging a few months before elections and comes crashing down in time. I’m not too worried and will still focus more on competing with the SPD.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4032, \"fields\": {\"question\": 725, \"description\": \"I will take this development very seriously. Let’s attack them as a party that prefers heavy-handed government intervention over market solutions.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4033, \"fields\": {\"question\": 725, \"description\": \"Off the record, it’s not the worst thing that these two parties compete for centre-left votes. This makes the path for us to come first a lot easier. Let’s try to focus a bit more on the Green Party now that they are in the lead.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4034, \"fields\": {\"question\": 725, \"description\": \"Actually, this is a bit ridiculous and reminds me of the publicity stunt the FDP pulled in 2002 when they nominated a chancellor candidate. Let’s mock them for their hubris and don’t refer to Baerbock as a chancellor candidate.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4035, \"fields\": {\"question\": 726, \"description\": \"Russia is not our enemy, though I’m very critical of some things Putin has done. The opening of the North Stream 2 Pipeline should be contingent on some conditions, like freeing Navalny.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4036, \"fields\": {\"question\": 726, \"description\": \"Kretschmer was clearly in the wrong here. It’s unclear how much negotiations with the current Russian regime can achieve. We should also immediately stop building the North Stream 2 pipeline.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4037, \"fields\": {\"question\": 726, \"description\": \"Kretschmer is completely right, we have to talk more with Russia, not less. I’m all in favour of more dialogue and stronger economic ties with Russia.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4038, \"fields\": {\"question\": 726, \"description\": \"This whole thing is overblown, the trip was mostly for cultural exchange. I don’t have much to say about this.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4039, \"fields\": {\"question\": 727, \"description\": \"This was a bad decision by the court. The Climate Protection Act already went far enough and I’m not in favour of hurting the economy with a strict climate policy.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4040, \"fields\": {\"question\": 727, \"description\": \"We should not move too quickly here and avoid being hasty. While the court order has to be respected, we have to analyze the situation in detail before we change any laws.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4041, \"fields\": {\"question\": 727, \"description\": \"As I’m not a member of the government, I don’t have much to say here. I trust them to find a sensible solution.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4042, \"fields\": {\"question\": 727, \"description\": \"Economy and ecology now require better and truly sustainable coordination with each other. This is an opportunity to work out a truly sustainable climate policy for our country.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4043, \"fields\": {\"question\": 728, \"description\": \"What else do people want me to say? I still stand by my statements, I’m a down-to-earth person, not part of some out-of-touch, super-rich elite.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4044, \"fields\": {\"question\": 728, \"description\": \"Politicizing my private life like this is nothing more than a smear campaign. I reject the notion that my personal wealth has anything to do with how well I will lead this country.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4045, \"fields\": {\"question\": 728, \"description\": \"I would like to apologize. After some reflection, I have realized that I’m richer than the middle class in this country. What I meant to say is that I’m still not part of an untouchable elite, but a regular guy.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4046, \"fields\": {\"question\": 728, \"description\": \"Who even dug up these two-year-old statements? I’ll give a brief comment that this has no relevance and hope that people focus on more important topics.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4047, \"fields\": {\"question\": 729, \"description\": \"For years and years, we have consistently missed the NATO aim to spend 2% of our gross domestic product on defence. I reaffirm our commitment to NATO and this goal!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4048, \"fields\": {\"question\": 729, \"description\": \"I specifically want to call out Annalena Baerbock. She’s lacking a clear commitment to NATO, which is not appropriate for a chancellor.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4049, \"fields\": {\"question\": 729, \"description\": \"Our defence policy is adequate as it is right now. While I want to strongly reaffirm my commitment to NATO, we don’t need to spend more on defence than we do right now.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4050, \"fields\": {\"question\": 729, \"description\": \"No government budget is growing as quickly as our defence budget. I reject the notion we are not doing enough, and the presidency of Donald Trump has shown that the USA is not always a reliable ally.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4051, \"fields\": {\"question\": 730, \"description\": \"I want to congratulate Haseloff for his strong performance. It shows that the citizens still trust the CDU to be the best governing party.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4052, \"fields\": {\"question\": 730, \"description\": \"Haseloff performed very well, but I also want to emphasize that the AfD lost votes. When we keep appealing to all people, we can win them back to our more democratic parties.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4053, \"fields\": {\"question\": 730, \"description\": \"This was a very strong performance. We should campaign together for the upcoming general elections.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4054, \"fields\": {\"question\": 731, \"description\": \"The pandemic and subsequent lockdowns have shown how ill-prepared our schools are. I want to put the focus primarily on improving the digital infrastructure of schools.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4055, \"fields\": {\"question\": 731, \"description\": \"Actually, we don’t have much to gain by talking about this topic. Let’s downplay it as much as we can and focus on other things.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4056, \"fields\": {\"question\": 731, \"description\": \"We want to modernize the digital infrastructure of Germany, be it in schools, in public administration or in the government itself.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4057, \"fields\": {\"question\": 731, \"description\": \"Digitalization is an important topic for us, and I want to especially emphasize that we need to finish the nationwide 5G mobile network by 2025.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4058, \"fields\": {\"question\": 732, \"description\": \"This was a tragic catastrophe, and affected regions now need help quickly and unbureaucratically. We all need to come together to help everyone affected through this.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4059, \"fields\": {\"question\": 732, \"description\": \"I first want to state that my empathy goes to all affected by this flooding. However, we have to learn lessons from this, like not building and rebuilding in areas that are so close to potential flooding zones.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4060, \"fields\": {\"question\": 732, \"description\": \"We need to help people after a catastrophe like this, both with the cleanup and with financial aid. We can’t leave people to deal with this on their own, they need aid from the government.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4061, \"fields\": {\"question\": 732, \"description\": \"The floodings were a tragedy, yes, but I firmly reject the notion to politicize this. We need to come together and help people, that’s more important than speculating if this was caused by climate change or not.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4062, \"fields\": {\"question\": 733, \"description\": \"Actually, I don’t want to be seen as performative. I won’t change my appointments, though I will mention the event in my speeches, of course.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4063, \"fields\": {\"question\": 733, \"description\": \"I want to get out there, yes, but let’s go to the areas close to my political district. They were not affected as heavily, but I think visiting them will make me seem more authentic.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4064, \"fields\": {\"question\": 733, \"description\": \"Just visiting these areas is not enough! I want to be seen as a man of action, with rubber boots and shovels and all.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4065, \"fields\": {\"question\": 733, \"description\": \"There are lots of politicians visiting the affected area - let’s coordinate so I go with Minister-President Laschet and German President Steinmeier, to show that we are all united.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4066, \"fields\": {\"question\": 734, \"description\": \"I haven’t been the strongest advocate for measures against climate change, but I’ve changed my mind. We need to do more, like phasing out coal power in the next ten years.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4067, \"fields\": {\"question\": 734, \"description\": \"Climate change is coming, whether we want it or not. We should be much better prepared in the future, but also we all have to be more aware of the risks.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4068, \"fields\": {\"question\": 734, \"description\": \"Even if we followed every demand of climate demonstrators, there would still be floodings in the future. I reject the notion that these two are as strongly connected as some say.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4069, \"fields\": {\"question\": 734, \"description\": \"One of the best things we could do to reduce our carbon emissions is to do more to make our energy production emit less. Continuing to produce nuclear energy until after 2022 could be very helpful in that regard.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4070, \"fields\": {\"question\": 735, \"description\": \"We don’t need mandatory vaccines for everyone, but it should be mandatory for some jobs, like hospital personnel.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4071, \"fields\": {\"question\": 735, \"description\": \"While I wouldn’t go that far, we can give people more incentives to get vaccinated, like opening up things only for vaccinated and recovered people.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4072, \"fields\": {\"question\": 735, \"description\": \"Covid is basically over, the case numbers are very low. I don’t see a problem in letting every citizen decide for themselves what is right for them, and I don’t think the state and health insurance necessarily should have to pay for those.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4073, \"fields\": {\"question\": 735, \"description\": \"I also think this is a good idea. We need to do everything we can to finally make Covid history.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4074, \"fields\": {\"question\": 736, \"description\": \"I refuse to dignify this with a response. This is nothing but a smear campaign, and everyone attacking me knows this.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4075, \"fields\": {\"question\": 736, \"description\": \"This attack is getting the facts all wrong. Rape of a spouse was already illegal, although under a different law, and I only voted against this because I wanted a slightly different law, that made it possible for the woman to stop the criminal proceedings.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4076, \"fields\": {\"question\": 736, \"description\": \"With the hindsight of twenty-five years, I wouldn’t vote the same way today. It was a different time, and we have all grown and learned since then.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4077, \"fields\": {\"question\": 736, \"description\": \"I stand by my vote. I don’t believe this change of law was necessary, and while this is settled law now, I personally don’t agree with the decision the parliament made. There’s no such thing as rape of a spouse.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4078, \"fields\": {\"question\": 737, \"description\": \"We will talk with all democratic parties - the SPD, the Greens and the FDP. Unfortunately, not all parties will rule out coalition talks with the extremist Left party.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4079, \"fields\": {\"question\": 737, \"description\": \"The grand coalition of the last 8 years is increasingly unpopular. We need to find a different governing majority.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4080, \"fields\": {\"question\": 737, \"description\": \"Actually, this new party spectrum needs new solutions. I think a Bahamas coalition with the AfD and the FDP could work.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4081, \"fields\": {\"question\": 737, \"description\": \"After the elections, we will see what coalitions are mathematically possible and negotiate accordingly.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4082, \"fields\": {\"question\": 738, \"description\": \"This rushed end to the NATO mission is a tragedy, most of all for the people in Afghanistan. We have to analyze what went wrong and learn our lessons.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4083, \"fields\": {\"question\": 738, \"description\": \"We have to be measured, but be prepared to take in some refugees, especially people who are now in danger because they cooperated with our troops.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4084, \"fields\": {\"question\": 738, \"description\": \"The foreign ministry under SPD control is clearly to blame for our part in this crisis, and Foreign Minister Maas should resign. His behaviour is just embarrassing.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4085, \"fields\": {\"question\": 738, \"description\": \"Despite the terrible pictures, the last thing we need now is more uncontrolled immigration. Taking in too many refugees back then was a political mistake we should not repeat under any circumstance.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4086, \"fields\": {\"question\": 739, \"description\": \"Scholz has been surging a lot in the polls recently and I worry that he will not stop. It seems foolish to do anything but attack him.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4087, \"fields\": {\"question\": 739, \"description\": \"Baerbock has been struggling lately, but I’m still worried about the Green Party pulling away votes from us. Let’s focus on her.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4088, \"fields\": {\"question\": 739, \"description\": \"I will leave petty attacks to my opponents and focus more on policy. I’m certain the German people will appreciate hearing concrete solutions to their problems more than attacks.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4089, \"fields\": {\"question\": 739, \"description\": \"Actually, I don’t want two left-wing politicians to gang up on me. Let the two of them duke it out, I won’t attend this so-called Triell.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4090, \"fields\": {\"question\": 740, \"description\": \"He likes to present himself as a moderate, but he hasn’t completely ruled out a coalition with the extremist Left party. Can voters really trust him not to form this coalition after the election?\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4091, \"fields\": {\"question\": 740, \"description\": \"Let’s hit him on his scandals as finance minister. Under his watch, Wirecard collapsed due to fraudulent dealings and lots of people lost their money. There was even a police raid on a government office belonging to his ministry.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4092, \"fields\": {\"question\": 740, \"description\": \"The program of his party is very leftwing, especially regarding pensions and the minimum wage. It shows that the SPD as a whole is unfit to govern.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4093, \"fields\": {\"question\": 740, \"description\": \"Actually, I’ve changed my mind. I’m just going to present myself as calm and above petty attacks.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4094, \"fields\": {\"question\": 741, \"description\": \"She’s had some problems with plagiarism in a book she’s written and inflated her CV. These might seem like minor things, but can she really be trusted to govern this country?\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4095, \"fields\": {\"question\": 741, \"description\": \"Everyone on this stage agrees that something has to be done about climate change, but trying to forbid everything as Mrs Baerbock and her party want can’t be the solution!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4096, \"fields\": {\"question\": 741, \"description\": \"I’ll attack her for her willingness to govern with the radical Left party. This coalition is unpopular, moderates should be frightened by this prospect.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4097, \"fields\": {\"question\": 741, \"description\": \"Actually, I’ve changed my mind. I’m just going to present myself as calm and above petty attacks.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4098, \"fields\": {\"question\": 742, \"description\": \"I want to present myself as the candidate having the best market-focused and realistic solutions for climate change. We need to find a balance between economy and ecology!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4099, \"fields\": {\"question\": 742, \"description\": \"With two left-leaning politicians debating against me, I will focus on our realistic spending goals. They want to raise taxes and spend more money on every little pet project, while I stand for lower taxes in the long run and fiscal stability.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4100, \"fields\": {\"question\": 742, \"description\": \"This country is in need of fresh leadership. After 16 years of Merkel and the Grand coalition, I’m the right man for the change this country needs.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4101, \"fields\": {\"question\": 742, \"description\": \"Actually, screw this! I will attack them both whenever an opportunity presents itself. That way, I can sharpen my profile and show myself as the most competent candidate.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4102, \"fields\": {\"question\": 743, \"description\": \"It’s important that all wings of our party stay united and motivated to vote. Let’s campaign with my rival from back in January, Armin Laschet.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4103, \"fields\": {\"question\": 743, \"description\": \"Who else but Angela Merkel could be the right person? She has won the last four elections, and while I don’t agree with her on every topic, she is still immensely popular.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4104, \"fields\": {\"question\": 743, \"description\": \"I’m worried about the AfD taking first place in some East German states. I want to campaign there with local CDU politicians like Haselhof and Kretschmer.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4105, \"fields\": {\"question\": 743, \"description\": \"Markus Söder and I didn’t always have the warmest relationship, but he is very popular in Bavaria. Let’s campaign with him there and show some unity between the CDU and CSU.\"}}]");
