campaignTrail_temp.answer_feedback_json = JSON.parse("[{\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5000, \"fields\": {\"answer\": 4000, \"candidate\": 77, \"answer_feedback\": \"A convincing enough argument to some, but unfortunately, not quite enough. You lose to Laschet and have to watch from the sidelines as he tries to become chancellor this fall.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5001, \"fields\": {\"answer\": 4001, \"candidate\": 77, \"answer_feedback\": \"While Röttgen and you come from different wings of the party, this works and with his endorsement, you closely win on the second ballot. Your focus on his environmental policies leaves your base a bit deflated, though.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5002, \"fields\": {\"answer\": 4002, \"candidate\": 77, \"answer_feedback\": \"It’s hard to thread the needle here, but you managed it. On the second ballot, you defeat Laschet and become the new leader of the CDU.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5003, \"fields\": {\"answer\": 4003, \"candidate\": 77, \"answer_feedback\": \"Considering you’ve been part of the CDU leadership in the early 2000s, you’re hardly a fresh face, even though you’ve been out of politics for a while. In the end, this argument is not enough. You lose to Laschet and have to watch from the sidelines as he tries to become chancellor this fall.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5004, \"fields\": {\"answer\": 4004, \"candidate\": 77, \"answer_feedback\": \"With how contentious the relationship between you and Merkel is, this just comes across as disingenuous.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5005, \"fields\": {\"answer\": 4005, \"candidate\": 77, \"answer_feedback\": \"You’re reaching out to the moderate wing of your party - however, they don’t really trust you, and the conservative wing is unhappy with this change in direction from you.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5006, \"fields\": {\"answer\": 4006, \"candidate\": 77, \"answer_feedback\": \"This is what the people who elected you wanted to hear. You can hopefully win back some voters from the AfD with this strategy, but be careful that you don’t lose too many moderate voters to other parties.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5007, \"fields\": {\"answer\": 4007, \"candidate\": 77, \"answer_feedback\": \"That’s one of the things on which you disagree most with Merkel - she’s sometimes almost governed like a Social Democrat. However, both views have supporters and detractors in the party and the population at large.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5008, \"fields\": {\"answer\": 4008, \"candidate\": 77, \"answer_feedback\": \"This is mostly ignored by the political establishment who opt for longer lockdowns amid surging case numbers. Your position is not all that popular\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5009, \"fields\": {\"answer\": 4009, \"candidate\": 77, \"answer_feedback\": \"With this position, you don’t really stand out among the people who actually decide this and have mostly similar positions. Also, lockdowns are unpopular in East Germany.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5010, \"fields\": {\"answer\": 4010, \"candidate\": 77, \"answer_feedback\": \"You come across as reasonable here, but don’t stand out much. But given how uninvolved you are with this decision, maybe not standing out is not too bad.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5011, \"fields\": {\"answer\": 4011, \"candidate\": 77, \"answer_feedback\": \"People expect more leadership from a future chancellor. This allows other politicians to outshine you.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5012, \"fields\": {\"answer\": 4012, \"candidate\": 77, \"answer_feedback\": \"This is a mainstream position in your party, but not what people elected you for. Conservatives worry if you’ll be that different from Merkel after all.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5013, \"fields\": {\"answer\": 4013, \"candidate\": 77, \"answer_feedback\": \"Disappointed voters turn towards the FDP and even AfD. This goes against everything you’ve been saying in the past, and pundits are confused about what made you change your mind this radically.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5014, \"fields\": {\"answer\": 4014, \"candidate\": 77, \"answer_feedback\": \"While this is a bit less radical than you are known for, it’s probably safer to moderate somewhat. It’s still a departure from what Merkel did, but that could be a good thing.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5015, \"fields\": {\"answer\": 4015, \"candidate\": 77, \"answer_feedback\": \"For more than 20 years, you have championed something like this. No one is surprised, though some moderates are uneasy and worried about fiscal stability and if that means big cuts to the welfare state.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5016, \"fields\": {\"answer\": 4016, \"candidate\": 77, \"answer_feedback\": \"This is a strong rebuke, but the scandal still hurts you. It also sounds to some like you’re trying to downplay the scandal.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5017, \"fields\": {\"answer\": 4017, \"candidate\": 77, \"answer_feedback\": \"People expected more from you, especially as more and more of these corrupt dealings come to light.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5018, \"fields\": {\"answer\": 4018, \"candidate\": 77, \"answer_feedback\": \"Despite your fiery rebuke, nobody is buying this, as the report is well sourced and new details come out almost every day. This makes you seem very out of touch with the public mood.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5019, \"fields\": {\"answer\": 4019, \"candidate\": 77, \"answer_feedback\": \"You, the man who switched from politics to Blackrock and back, are absolutely the wrong man to strike this populist tone hear. No one trusts you’re serious with this statement.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5020, \"fields\": {\"answer\": 4020, \"candidate\": 77, \"answer_feedback\": \"To your surprise, Söder tells you he wants to become the candidate for the CDU/CSU as well. You both make your intentions public on the same day. This might become ugly…\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5021, \"fields\": {\"answer\": 4021, \"candidate\": 77, \"answer_feedback\": \"Journalists are surprised by what seems like a hasty announcement. Days later, Söder declares his intention to become the chancellor candidate for the CDU/CSU as well. At least it looks like you have a small headstart.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5022, \"fields\": {\"answer\": 4022, \"candidate\": 77, \"answer_feedback\": \"This backfires when Söder declares his intention to become the chancellor candidate for the CDU/CSU. You quickly follow suit, but this doesn’t make you look good.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5023, \"fields\": {\"answer\": 4023, \"candidate\": 77, \"answer_feedback\": \"There’s one small problem with this plan- the party elites, Merkel included, prefer Söder over you. Their manoeuvring behind the scenes makes sure he gets the candidacy. Now you have to watch as he tries to become chancellor!\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5024, \"fields\": {\"answer\": 4024, \"candidate\": 77, \"answer_feedback\": \"Söder tries to fight back against this attack, and says he only does what he believes is right, but eventually backs down when more and more people take your side. This ordeal still damaged you in the polls, though.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5025, \"fields\": {\"answer\": 4025, \"candidate\": 77, \"answer_feedback\": \"While this is true, a lot of people in the CDU also prefer Söder, especially in the current parliamentary group. You narrowly lose the vote and have to have to watch as Söder tries to win the chancellorship.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5026, \"fields\": {\"answer\": 4026, \"candidate\": 77, \"answer_feedback\": \"It is a very close vote, but you manage to squeak through. It has shown how divided the party opinion is on you though and damaged your standing in the polls.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5027, \"fields\": {\"answer\": 4027, \"candidate\": 77, \"answer_feedback\": \"Söder can’t even bring himself to smile as you say this. With how much he dislikes you, it’s unlikely he will be a big help during the election campaign\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5028, \"fields\": {\"answer\": 4028, \"candidate\": 77, \"answer_feedback\": \"Now that you’re officially the chancellor candidate, moderating a bit is not the worst call.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5029, \"fields\": {\"answer\": 4029, \"candidate\": 77, \"answer_feedback\": \"Your speech is very bland and receives mixed reviews.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5030, \"fields\": {\"answer\": 4030, \"candidate\": 77, \"answer_feedback\": \"While your party has been in government for almost 16 years, you stand for something different than the current administration. There are both people who want something different and who were happy with the more modern CDU, though.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5031, \"fields\": {\"answer\": 4031, \"candidate\": 77, \"answer_feedback\": \"Maybe you’re onto something, though ignoring Baerbock seems foolish in the current situation.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5032, \"fields\": {\"answer\": 4032, \"candidate\": 77, \"answer_feedback\": \"This helps win back some potential Green party voters who are concerned about some of their specific policies.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5033, \"fields\": {\"answer\": 4033, \"candidate\": 77, \"answer_feedback\": \"You’re probably right, but your party has lost some voters to the Greens too. You shouldn’t become too comfortable.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5034, \"fields\": {\"answer\": 4034, \"candidate\": 77, \"answer_feedback\": \"This seems very petty and even desperate considering the current polling. Also, you might need the Green party as a coalition partner and making fun of them like this will make the negotiations harder.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5035, \"fields\": {\"answer\": 4035, \"candidate\": 77, \"answer_feedback\": \"A nuanced take that is appreciated by many voters - though especially in East Germany, people want more business cooperation with Russia\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5036, \"fields\": {\"answer\": 4036, \"candidate\": 77, \"answer_feedback\": \"You stay consistent with some earlier statements you’ve made, but this is definitively tougher on Russia than the median opinion. Criticizing Kretschmer might also hurt you in Saxony\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5037, \"fields\": {\"answer\": 4037, \"candidate\": 77, \"answer_feedback\": \"This is both a massive flip-flop considering your own opinions and more lenient on Russia than a lot of people like, especially in West Germany.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5038, \"fields\": {\"answer\": 4038, \"candidate\": 77, \"answer_feedback\": \"As much as you might want to, this issue isn’t going away. You pleased no one with this statement.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5039, \"fields\": {\"answer\": 4039, \"candidate\": 77, \"answer_feedback\": \"The mood in this country is not receptive to statements like this. You get harsh criticism from the Greens and even some in your own party.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5040, \"fields\": {\"answer\": 4040, \"candidate\": 77, \"answer_feedback\": \"Indirectly, you criticize the government that tries to quickly change the law here. Party unity might be endangered, with the conservative wing siding with you and the moderates with Merkel.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5041, \"fields\": {\"answer\": 4041, \"candidate\": 77, \"answer_feedback\": \"No one is pleased, but you also avoided criticizing the current administration or publicly changing your own view.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5042, \"fields\": {\"answer\": 4042, \"candidate\": 77, \"answer_feedback\": \"Voters of the Green Party and the moderate wing of your party are happy about this statement, though some accuse you of being opportunistic. This should make coalition talks with the Greens easier, too.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5043, \"fields\": {\"answer\": 4043, \"candidate\": 77, \"answer_feedback\": \"Doubling down might not be the wisest action here - pictures of your private jets especially make many people doubt how down-to-earth you really are.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5044, \"fields\": {\"answer\": 4044, \"candidate\": 77, \"answer_feedback\": \"Since these comments were originally made by you, it’s a bit odd that you claim others are politicizing your private life.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5045, \"fields\": {\"answer\": 4045, \"candidate\": 77, \"answer_feedback\": \"It helps to admit you were wrong, though as much as you might want it, you just aren’t seen as a regular guy.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5046, \"fields\": {\"answer\": 4046, \"candidate\": 77, \"answer_feedback\": \"After a few days of media coverage, all but the most left-wing publication move on from this.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5047, \"fields\": {\"answer\": 4047, \"candidate\": 77, \"answer_feedback\": \"The audience cheers you on, as spending more on defence is always popular in more conservative circles. Not every potential voter is convinced of this, though.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5048, \"fields\": {\"answer\": 4048, \"candidate\": 77, \"answer_feedback\": \"With how strong the Green Party has been in the polls lately, hitting on them seems like a good strategy. It’s a bit of a vulnerable point.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5049, \"fields\": {\"answer\": 4049, \"candidate\": 77, \"answer_feedback\": \"This does little to differentiate you from other parties and is softer on defence than the usual position of your party.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5050, \"fields\": {\"answer\": 4050, \"candidate\": 77, \"answer_feedback\": \"Criticizing the USA so strongly does not play all that well in your party.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5051, \"fields\": {\"answer\": 4051, \"candidate\": 77, \"answer_feedback\": \"While his performance was impressive, it might have to do something with incumbency. Still, it’s not a bad sign.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5052, \"fields\": {\"answer\": 4052, \"candidate\": 77, \"answer_feedback\": \"Winning back AfD voters is something the CDU has tried for years. Hopefully, you can succeed with it this fall.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5053, \"fields\": {\"answer\": 4053, \"candidate\": 77, \"answer_feedback\": \"Haseloff is glad to campaign with you. This will help you in Saxony-Anhalt and maybe in neighbouring regions.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5054, \"fields\": {\"answer\": 4054, \"candidate\": 77, \"answer_feedback\": \"You’re right that this is an important topic, but many blame your party for the current misery. Maybe it’s best not to focus on it so strongly.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5055, \"fields\": {\"answer\": 4055, \"candidate\": 77, \"answer_feedback\": \"It’s not the most important topic this election, but especially young voters are disappointed by your lack of a proper position.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5056, \"fields\": {\"answer\": 4056, \"candidate\": 77, \"answer_feedback\": \"Most parties are calling for something like this, and you don’t differentiate yourself from them.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5057, \"fields\": {\"answer\": 4057, \"candidate\": 77, \"answer_feedback\": \"This is a strong promise that will especially help you in less urban areas.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5058, \"fields\": {\"answer\": 4058, \"candidate\": 77, \"answer_feedback\": \"This response will help you in those areas, though some say that this is the least you can do.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5059, \"fields\": {\"answer\": 4059, \"candidate\": 77, \"answer_feedback\": \"Some experts agree with you, though you come across as a bit heartless with that statement, as many people want to rebuild their homes.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5060, \"fields\": {\"answer\": 4060, \"candidate\": 77, \"answer_feedback\": \"Giving financial aid to people affected here goes against your own philosophy and is seen as opportunistic by many.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5061, \"fields\": {\"answer\": 4061, \"candidate\": 77, \"answer_feedback\": \"Some people applaud your clear words. Others say that not connecting this with climate state is also a political statement.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5062, \"fields\": {\"answer\": 4062, \"candidate\": 77, \"answer_feedback\": \"This way, you don’t get as much media coverage as the other candidates who are willing to travel there.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5063, \"fields\": {\"answer\": 4063, \"candidate\": 77, \"answer_feedback\": \"The people appreciate your visit, but this is very low-key for a chancellor candidate\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5064, \"fields\": {\"answer\": 4064, \"candidate\": 77, \"answer_feedback\": \"This might have worked for former chancellor Schröder, but you just look awkward and stilted, like you are just posing for pictures.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5065, \"fields\": {\"answer\": 4065, \"candidate\": 77, \"answer_feedback\": \"During the visit, a picture is made of Laschet laughing that dominates the media coverage. At least you don’t stand directly next to him.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5066, \"fields\": {\"answer\": 4066, \"candidate\": 77, \"answer_feedback\": \"Coal-producing regions are very unhappy and this is quite a change in position for you. It might keep some moderates from switching to the Green Party.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5067, \"fields\": {\"answer\": 4067, \"candidate\": 77, \"answer_feedback\": \"You sound a bit detached and light on policy, but most people are satisfied.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5068, \"fields\": {\"answer\": 4068, \"candidate\": 77, \"answer_feedback\": \"This statement positions you firmly in a more climate-sceptical camp and is against the public mood.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5069, \"fields\": {\"answer\": 4069, \"candidate\": 77, \"answer_feedback\": \"This is a controversial topic, with nuclear energy having supporters and detractors. It also positions you against Merkel, but that is to be expected from you.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5070, \"fields\": {\"answer\": 4070, \"candidate\": 77, \"answer_feedback\": \"There are people for whom even that goes to far, but this position is broadly popular.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5071, \"fields\": {\"answer\": 4071, \"candidate\": 77, \"answer_feedback\": \"This statement is received quite well overall and might make vaccinations more attractive. You might lose voters sceptical about vaccinations though.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5072, \"fields\": {\"answer\": 4072, \"candidate\": 77, \"answer_feedback\": \"Anti-Covid Querdenker cheer you on, though at the cost of sharp criticism from everyone else.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5073, \"fields\": {\"answer\": 4073, \"candidate\": 77, \"answer_feedback\": \"You’ve positioned yourself at the fringe of the conversation, compulsory vaccinations are generally unpopular.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5074, \"fields\": {\"answer\": 4074, \"candidate\": 77, \"answer_feedback\": \"You did vote like this, and by not replying to the claim at all, you give your opponents free rein to attack you.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5075, \"fields\": {\"answer\": 4075, \"candidate\": 77, \"answer_feedback\": \"As much as you’re trying to finesse this, “having voted against making rape illegal” is not a good look at more catchy than your long-winded explanations.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5076, \"fields\": {\"answer\": 4076, \"candidate\": 77, \"answer_feedback\": \"Are you trying to sound old and out of touch?\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5077, \"fields\": {\"answer\": 4077, \"candidate\": 77, \"answer_feedback\": \"Twenty-five years ago this might have been just controversial. Now, a statement like this is political suicide.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5078, \"fields\": {\"answer\": 4078, \"candidate\": 77, \"answer_feedback\": \"This is your expected answer, but needling Scholz and Baerbock on their unclear statements towards the Left party plays well with your base.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5079, \"fields\": {\"answer\": 4079, \"candidate\": 77, \"answer_feedback\": \"You’re right, though another grand coalition might be a good path to power for you, and this makes it a harder sell after the election.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5080, \"fields\": {\"answer\": 4080, \"candidate\": 77, \"answer_feedback\": \"Even for someone as conservative as you, this is an unexpectedly strong statement. A coalition containing the AfD is poison to moderate voters, and both the SPD and the Green party rule out a coalition with you in turn.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5081, \"fields\": {\"answer\": 4081, \"candidate\": 77, \"answer_feedback\": \"A weirdly non-commital statement. Some even take this as a covert offer to the AfD.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5082, \"fields\": {\"answer\": 4082, \"candidate\": 77, \"answer_feedback\": \"People notice your avoidance of making a strong statement about the situation. This makes you seem indecisive.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5083, \"fields\": {\"answer\": 4083, \"candidate\": 77, \"answer_feedback\": \"It’s unclear how you want to actually evacuate them, and conservatives are unhappy to hear you of all people advocate for taking in refugees.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5084, \"fields\": {\"answer\": 4084, \"candidate\": 77, \"answer_feedback\": \"The SPD retorts by blaming the CDU-led defence ministry. This mudslinging is unproductive and such a strong attack so shortly before an election seems politically motivated to many people.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5085, \"fields\": {\"answer\": 4085, \"candidate\": 77, \"answer_feedback\": \"This is sharply criticized by more left-wing parties. Conservatives cheer you on though and maybe a silent majority agrees with this view.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5086, \"fields\": {\"answer\": 4086, \"candidate\": 77, \"answer_feedback\": \"It seems right now like Scholz has become your main opponent, so this seems like a prudent choice.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5087, \"fields\": {\"answer\": 4087, \"candidate\": 77, \"answer_feedback\": \"Her numbers keep slipping, but there might be an argument that there are voters to be won back from her.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5088, \"fields\": {\"answer\": 4088, \"candidate\": 77, \"answer_feedback\": \"Let’s hope taking the high road helps you stand out!\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5089, \"fields\": {\"answer\": 4089, \"candidate\": 77, \"answer_feedback\": \"Most pundits question your judgment, though a few conservatives applaud you. However, this makes it look to people like the race is between Baerbock and Scholz.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5090, \"fields\": {\"answer\": 4090, \"candidate\": 77, \"answer_feedback\": \"Scholz is in a bit of an awkward spot with this attack and doesn’t give a clear answer. He accuses you of not doing enough to delimit yourself from the AfD in turn. Overall, Baerbock wins the debate.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5091, \"fields\": {\"answer\": 4091, \"candidate\": 77, \"answer_feedback\": \"A damaging attack, though you have not been the cleanest politician in the past - for example, you lobbied against rules for MPs to make their earnings public. This opens you up to damaging counterattacks, and Barbock wins the debate overall.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5092, \"fields\": {\"answer\": 4092, \"candidate\": 77, \"answer_feedback\": \"This might seem like an odd avenue of attack considering how long the CDU/CSU and SPD governed together successfully, but you really sell it. Overall, you win the debate.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5093, \"fields\": {\"answer\": 4093, \"candidate\": 77, \"answer_feedback\": \"Since you haven’t prepared for this strategy, this doesn’t help you. Scholz is seen as the winner of the debate.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5094, \"fields\": {\"answer\": 4094, \"candidate\": 77, \"answer_feedback\": \"This is something she struggled with in the past, so the attack is quite damaging. Overall, you and Scholz tie the debate.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5095, \"fields\": {\"answer\": 4095, \"candidate\": 77, \"answer_feedback\": \"This devolves into a heated back and forth between the two of you with no clear winner. Scholz wins the debate.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5096, \"fields\": {\"answer\": 4096, \"candidate\": 77, \"answer_feedback\": \"Many Green voters aren’t against this potential coalition, so this attack isn’t all that effective. Overall, Scholz wins the debate.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5097, \"fields\": {\"answer\": 4097, \"candidate\": 77, \"answer_feedback\": \"Since you haven’t prepared for this strategy, this doesn’t help you. Overall, Scholz wins the debate.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5098, \"fields\": {\"answer\": 4098, \"candidate\": 77, \"answer_feedback\": \"Baerbock criticises you sharply, and you are drawn into back-and-forths after all. Overall, Scholz wins the debate.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5099, \"fields\": {\"answer\": 4099, \"candidate\": 77, \"answer_feedback\": \"A core argument your party likes to make, and you make it very effectively and show a sharp contrast to Scholz and Baerbock. Overall, you win the debate.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5100, \"fields\": {\"answer\": 4100, \"candidate\": 77, \"answer_feedback\": \"Scholz is vice chancellor of the governing coalition, but Baerbock is both younger and a member of a party that hasn’t been in government for 16 years. She steals your argument and wins the debate.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5101, \"fields\": {\"answer\": 4101, \"candidate\": 77, \"answer_feedback\": \"You come across as unprepared and overly aggressive. This doesn’t help you at all and overall, Scholz wins the debate.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5102, \"fields\": {\"answer\": 4102, \"candidate\": 77, \"answer_feedback\": \"This helps you both with the moderate wing of the party and in North Rhine-Westphalia. Good luck tonight!\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5103, \"fields\": {\"answer\": 4103, \"candidate\": 77, \"answer_feedback\": \"Merkel outright refuses to appear with you. She says it’s due to conflicting schedules, but to you, it seems like she’s training to sabotage you. Good luck tonight!\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5104, \"fields\": {\"answer\": 4104, \"candidate\": 77, \"answer_feedback\": \"Hopefully this will keep the AfD in line.  Good luck tonight!\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5105, \"fields\": {\"answer\": 4105, \"candidate\": 77, \"answer_feedback\": \"He is definitely popular, but not at all enthusiastic about campaigning with you. Still, you have a few events together. Good luck tonight!\"}}]");
